  true,\n\t\"url\": null,\n\t\"notes\": \"As part of the BLUElink> Ocean Forecasting
  Australia project (http://www.bom.gov.au/oceanography/projects/BLUElink/), the Australian
  Bureau of Meteorology has modified its pre-existing operational regional 1/4 degree
  resolution optimal interpolation SST analysis system to produce 1/12 degree resolution,
  daily SST analyses over the Australian region (20N - 70S, 60E - 170W).  The new
  Regional Australian Multi-Sensor SST Analysis (RAMSSA) v1.0 system combines SST
  data from infrared (AVHRR and AATSR) and microwave (AMSR-E) sensors on polar-orbiting
  satellites with in situ measurements from the GTS to produce daily foundation SST
  estimates, largely free of nocturnal cooling and diurnal warming effects.\",\n\t\"license_title\":
